import "../../style/App.scss";
import Header from "../Header/Header";
import Main from "../Main/Main";
import Table from "../Main/Table";
import Footer from "../Footer/Footer";
import data from "../../words.json";

function App() {
  return (
    <div className="App">
      <Header />
      <Main arrWords={data.words}></Main>
      <Table />
      <Footer />
    </div>
  );
}

export default App;
